import React from "react";
import { data } from "../navbar";
const NavBar = () => {
  return (
    <div>
      {fetch("./navbar.json")
        .then((response) => response.json())
        .then((obj) => {
          return <div>{obj.type}</div>;
        })}
    </div>
  );
};
export default NavBar;
